import routes from '@/router'
import { Routes, Route } from 'react-router-dom'
import { Suspense } from 'react'

function App() {
  return (
    <div className="App">
      <Suspense>
        <Routes>
          {routes.map(route => (<Route path={route.url} element={<route.component/>} key={route.url}/>))}
        </Routes>
      </Suspense>
    </div>
  )
}

export default App;
